Šiemet pirmą kartą Dakaro ralio organizatoriai nusprendė automobilius pilnai patikrinti dar prieš jiems išplaukiant į Pietų Ameriką, kai tuo tarpu ankščiau dalis komisijų dar laukdavo prieš pat lenktynių startą. „Mes ir ankstesniais metais stengdavomės kuo daugiau dalykų su varžybų techniniais komisarais pasitvirtinti dar Europoje, tik šįkart esam 100 proc. patikrinti. Sudėtos visos plombos, gauti visi štampai ir parašai, suklijuoti lipdukai – nuvykus į Pietų Ameriką beliks tik persižiūrėti kaip automobilis atlaikė kelionę“, – dalinosi A. Juknevičius. „Visa tai – tik formalumai. Mes visus metus ruošiamės, technikai žino, kas laukia ir ko tikisi organizatoriai, todėl nieko nelaukdami iš pat ryto keliavome į uostą. Taip išėjo, kad tapome pirmuoju oficialiai komisiją praėjusiu bolidu iš visų dalyvių.“ Vakar Dakaro ralio pasiruošime įjungta aukštesnė pavara – Prancūzijoje buvo detaliai pristatytas jubiliejinio maratono maršrutas, išdalinti startiniai komandų numeriai, paskelbta ir detali sunkiausio pasaulio varžybų statistika. 2018-aisiais varžybose startuos 525-i dalyviai iš 54-ių šalių – daugiausiai jų sudarys prancūzai, olandai ir argentiniečiai. Automobilių klasėje, kur varžysis ir trys lietuviškos komandos iš viso prie starto linijos Peru sostinėje Limoje stos 105 ekipažai. Motociklininkų ir keturračių bus 190. (function(d, s, i, r) {
